> Top News The Trump swagger is seen, not always loved, worldwide FILE - In this Sept. 28, 2015, file photo, a supporter of Republican presidential candidate Donald Trump reacts to a joke Trump made about Russian President Vladimir Putin being a nicer person than him during a news conference in New York. Trump is well known in many parts of the world. He’s known in the Himalayas, far from any sign with his name on it. And in the Middle East, Africa and beyond. He’s clearly a recognized name worldwide, which is not to say he’s a loved one. (AP Photo/Julie Jacobson, File) 
